import PropTypes from 'prop-types';


class Contact extends Component {
    render() {
        const {name,email,phone}    =   this.props;
        return (
            <div>
                <h4>{name}</h4>
                <ul>
                    <li>{email}</li>
                    <li>{phone} </li>
                </ul>
            </div>
        )
    }
}

Contact.PropTypes   =   {
    name:   PropTypes.string.isRequired,
    email:  Pro
}

export default Contact;
